create table effects_templates
(
    Id             int          not null
        primary key,
    DescriptionId  int unsigned not null,
    IconId         int          not null,
    Characteristic int          not null,
    Category       int unsigned not null,
    Operator       mediumtext   not null,
    ShowInTooltip  tinyint      not null,
    UseDice        tinyint      not null,
    ForceMinMax    tinyint      not null,
    Boost          tinyint      not null,
    Active         tinyint      not null,
    ShowInSet      tinyint      not null,
    BonusType      int          not null,
    UseInFight     tinyint      not null,
    OppositeId     int          not null,
    EffectPriority int          not null
)
    engine = MyISAM
    charset = utf8;

